import Alert from 'react-bootstrap/Alert'

export default function CustomPage(el) {
    try {
        var dc = require('../components/custom-page/' + el.name + '.js');
        return dc.default();
    } catch (e) {
        return (
            <Alert variant="danger">Page Not Found</Alert>
        )
    }
}
